      Thành lập tháng 12/1999, bằng tầm nhìn "Chúng ta cùng thành công", SSI đã vững vàng ở vị thế định chế tài chính hàng đầu Việt Nam, đơn vị Anh hùng Lao động thời kỳ đổi mới, với giá trị thương hiệu và uy tín hấp dẫn nhất thị trường
Nỗ lực mang đến những sản phẩm tài chính hiệu quả, toàn diện, chúng tôi luôn lắng nghe và chuyên tâm tìm kiếm giải pháp ưu việt cho khách hàng trong các lĩnh vực Dịch vụ Chứng khoán Khách hàng Cá nhân, Dịch vụ Chứng khoán Khách hàng Tổ chức, Quản lý quỹ đầu tư, Dịch vụ Ngân hàng đầu tư, Nguồn vốn và Kinh doanh tài chính
Tự hào mang trong mình sứ mệnh dẫn dắt của tổ chức đứng đầu, SSI là nơi hội tụ của các chuyên gia đầu ngành tài chính - tiên phong, nhiệt huyết,  sẵn sàng đón nhận cơ hội và không ngừng chinh phục thử thách mới. Môi trường làm việc hiện đại, chuyên nghiệp, đặc biệt là hệ thống chính sách đãi ngộ toàn diện, hấp dẫn cùng quan điểm "Sự phát triển toàn diện của mỗi cá nhân sẽ hình thành sự phát triển bền vững của Công ty".

Established in December 1999, with the vision of "The business of success", SSI has firmly positioned ourselves as the leading financial institution in Vietnam, the Hero of Labor during the Renovation period, with the most attractive brand name and prestige in the market.

Striving to provide the most effective and comprehensive financial products, SSI always listening and dedicated to seeking superior solutions for customers in the fiels of Retail Securities Services, Institutional Securities Services, Asset Management, Investment Banking, and Treasury.
Proudly carrying the leading mission of the leading organization, SSI is the convergence of leading financial experts – pioneering, enthusiastic, ready to accept opportunities and constantly conquer new challenges.

SSI provides a modern and professional working environment, especially a comprehensive and attractive remuneration system with the viewpoint "The comprehensive development of each individual will form the sustainable development of the Company". 
